import React from "react";
import ".././App.css";

class Timer extends React.Component {
  render() {
    return (
      <div>
        <h1>This page</h1>
        {
          <button
            onclick={ev => {
              ev.preventDefault();
              this.props.handleSetState("login");
            }}
          >
            Voltar
          </button>
        }
      </div>
    );
  }
}

export default Timer;
